","keccak256":"0x14a6c4dce2a653a262b585f434be731f622fe55d4f670c275ab618f2c185a0dd","license":"MIT"},"contracts/strategies/StratPancakeLpV1.sol":{"content":"// contracts/strategies/StratPancakeLpV1.sol
